import React from 'react'
import { useState } from 'react'

export default function TodoList() {
        const [todos, setTodos] = useState([]);

        const addTodo = (todo) => {
            setTodos([...todos, todo]);
        };

        return (
            <div>
                <h1>Todo List</h1>
                <ul>
                    {todos.map((todo) => (
                        <li key={todo.id}>{todo}</li>
                    ))}
                </ul>
                <input type="text" placeholder="Add a new todo" onInput={(e) => addTodo(e.target.value)} />
                <button> add todo</button>

            </div>
        );
    }
